    [CascadingParameter]
    Task<AuthenticationState> authenticationStateTask { get; set; }

    public System.Security.Claims.ClaimsPrincipal user;
    private string userName;
    protected override async Task OnInitializedAsync()
    {
        await UpdateUser();
